class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function maximumTripletValue($nums) {
        $maxValue = 0;
        $n = count($nums);

        for ($i = 0; $i < $n - 2; $i++) {
            for ($j = $i + 1; $j < $n - 1; $j++) {
                for ($k = $j + 1; $k < $n; $k++) {
                    $tripletValue = ($nums[$i] - $nums[$j]) * $nums[$k];
                    $maxValue = max($maxValue, $tripletValue);
                }
            }
        }

        return $maxValue;
    }
}
